import { filter } from 'lodash';
import {
  Card,
  Table,
  Stack,
  Avatar,
  Button,
  Checkbox,
  TableRow,
  TableBody,
  TableCell,
  Container,
  Typography,
  TableContainer,
  TablePagination,
  createSvgIcon,
  IconButton
} from '@mui/material';
import { Icon } from '@iconify/react';
import CreateIcon from '@mui/icons-material/Create';
import { Link as RouterLink } from 'react-router-dom';
import * as React from 'react';
import { useState, useEffect } from 'react';
import Page from '../components/Page';
import { UserListHead, UserListToolbar, UserMoreMenu } from '../components/_dashboard/user';
import Scrollbar from '../components/Scrollbar';
//

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const TABLE_HEAD = [
  { id: 'name', label: 'Product Name', alignRight: false },
  { id: 'cost', label: 'Cost Price (in Rs.)', alignRight: false },
  { id: 'sale', label: 'Sale Price (in Rs.)', alignRight: false },
  { id: 'stock', label: 'Stock Quantity', alignRight: false },
  { id: 'action', label: 'Action', alignRight: false }
];

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9)
];

function descendingComparator(a, b, orderBy) {
  if (b[orderBy] < a[orderBy]) {
    return -1;
  }
  if (b[orderBy] > a[orderBy]) {
    return 1;
  }
  return 0;
}

function getComparator(order, orderBy) {
  return order === 'desc'
    ? (a, b) => descendingComparator(a, b, orderBy)
    : (a, b) => -descendingComparator(a, b, orderBy);
}

function applySortFilter(array, comparator, query) {
  const stabilizedThis = array.map((el, index) => [el, index]);
  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });
  if (query) {
    return filter(array, (_user) => _user.name.toLowerCase().indexOf(query.toLowerCase()) !== -1);
  }
  return stabilizedThis.map((el) => el[0]);
}

export default function Purchase() {
  const [categories, setCategoy] = useState([]);

  const CATEGORYLIST = [
    { name: 'Gift For Her', cost: '1200' },
    { name: 'Birthday Cake', cost: '590' },
    { name: 'Redvelvet Cake', cost: '530' },
    { name: '10 Rose Bouquet', cost: '800' },
    { name: 'Magic Mirror', cost: '1280' },
    { name: 'Customized Cup', cost: '120' },
    { name: 'Personalized Bottle', cost: '300' },
    { name: 'Plant', cost: '200' }
  ];

  return (
    <Page title="PURCHASES - BIZHOPS" backgroundColor="whitesmoke">
      <Container m={2}>
        <Box sx={{ width: '70%' }}>
          <Button variant="contained" color="info" startIcon={<FileDownloadOutlinedIcon />}>
            Import
          </Button>
          &nbsp;&nbsp;
          <Button variant="contained" color="info" startIcon={<FileUploadOutlinedIcon />}>
            Export
          </Button>
          &nbsp;&nbsp;
          <Button variant="contained" color="error" startIcon={<DeleteIcon />}>
            Delete
          </Button>
        </Box>
      </Container>
    </Page>
  );
}
